import { Avatar, Box, withStyles } from "@material-ui/core";
import React from "react";
import IQuiz from "../../../../Models/IQuiz";

interface IProps {
  quizID: number;
  percentage: number;
  quiz: IQuiz;
}

const RetakePrompt = ({ quizID, percentage, quiz }) => {
  return (
    <Container>
      <ImageContainer>
        <Avatar
          alt={`${quiz.title}`}
          src={`${quiz.image_link}`}
          style={{ height: "80px", width: "80px" }}
        />
      </ImageContainer>
      <TitleAndScoreContainer>
        <Title>{`${quiz.title}`}</Title>
        <Score>{`Score: ${percentage.toFixed(2)}`}</Score>
      </TitleAndScoreContainer>
    </Container>
  );
};

export default RetakePrompt;

const Container = withStyles({
  root: {
    width: "100%",
    padding: "2rem 1rem",
    display: "flex",
    alignItems: "center",
    color: "#252525C7",
    marginTop: "2rem",
    borderRadius: 5,
    minHeight: 100,
    margin: "0 4rem",
    background:
      "transparent linear-gradient(180deg, #BAE3F9 0%, #87B2DF 100%) 0% 0% no-repeat padding-box",
  },
})(Box);

const ImageContainer = withStyles({
  root: {
    margin: "0rem 1rem 0rem 3rem",
  },
})(Box);

const TitleAndScoreContainer = withStyles({
  root: {
    display: "flex",
    flexDirection: "column",
  },
})(Box);

const Title = withStyles({
  root: {
    fontWeight: 700,
    fontSize: "1.2rem",
    textTransform: "capitalize",
  },
})(Box);

const Score = withStyles({
  root: {
    fontWeight: 500,
  },
})(Box);
